`
       svg {
           position: absolute;
       }
       .ghost {
           opacity: 0.5;
       }
       .node {
           fill: #cccccc;
       }
       .node.application {
           fill: #005c99;
       }
       .link-handle {
           display: none;
           fill: black;
           opacity: 0.1;
           transition:r 0.25s ease-out;
       }
       .edge-group:not(.provides) .link-handle {
           display: initial
       }
       .link-handle:hover {
           opacity: 0.7; r: 5;
       }
       .text {
           fill: black;
           font-size: 6pt;
           text-overflow: ellipsis;
           word-break: break-word;
       }
       .application .text {
           fill: white;
       }
       .application.undeployed .deployment-indicator {
           fill: white;
       }
       .application.error .deployment-indicator {
           fill: red;
       }
       .application.deployed .deployment-indicator {
           fill: lightgreen;
       }
       .application.pending .deployment-indicator {
           fill: gold;
           animation-name: pending;
           animation-duration: 2s;
           animation-iteration-count: infinite;
           animation-timing-function: linear;
       }
       @keyframes pending {
           20% {opacity: 0.2};
           50% {opacity: 1};
           10% {opacity: 1};
       }
       .text.title {
           font-size: 8pt;
           text-decoration: underline;
           text-overflow: ellipsis;
           word-break: break-all;
       }
       .service .title {
           cursor: pointer;
       }
       .text.interface-name {
           text-overflow: ellipsis;
           word-break: break-all;
       }
       .text.protocol {
           opacity: 0.75;
           font-size: 5pt;
           text-overflow: ellipsis;
           word-break: break-all;
       }
       .text.version {
           word-break: break-all;
           cursor: pointer;
       }
       .text.version:hover {
           text-decoration: underline;
       }
       .node:not(.application):not(.selected).hovered {
           fill: #dfdfdf;
       }
       .node.application.hovered {
           fill: #0099ff;
       }
       .node .foreground {
           fill: #dfdfdf;
       }
       .node:not(.selected).hovered .foreground {
           fill: #efefef;
       }
       .hovered:not(.service-interface) .link-handle {
           display: initial;
       }
       .node.selected {
           fill: #ccff99;
       }
       .edge {
           stroke-linecap: round;
       }
       .includes .edge {
           stroke: #0099ff;
           stroke-width: 2;
       }
       .includes .marker {
           fill: #0099ff;
       }
       .provides .edge {
           stroke: #00ff33;
       }
       .interface-connection .edge {
           stroke-dasharray: 3 2;
       }
       .highlight-outgoing .edge {
           stroke: red;
       }
       .highlight-incoming .edge {
           stroke: green;
       }
       .highlight-outgoing .marker {
           fill: red;
       }
       .highlight-incoming .marker {
           fill: green;
       }`

